import  './Category.css'

const Category = ({FilterCategory}) => {

const Fcategory = (cat) =>{

  FilterCategory(cat)
}

  return (
    <div className='Category'>
    <button type="button" className="btn btn-primary me-3">All</button>
    <button type="button" className="btn btn-secondary me-3"><i class="fa-solid fa-laptop-mobile"></i>Technologie</button>
     <button type="button" onClick={()=>Fcategory('Men')} className="btn btn-danger me-3">Men</button>
     <button type="button" onClick={()=>Fcategory('Women')} className="btn btn-info">Wemen</button>
      </div>
  )
}

export default Category
